// src/pages/Landing/Landing.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Landing.css';

const faqData = [
  {
    question: "Is RoomieRadar free to use?",
    answer: "Yes! The basic questionnaire, compatibility check and seeing matches is completely free...",
  },
  {
    question: "How accurate is the compatibility score?",
    answer: "It's based on weighted lifestyle factors that students and young adults usually care about most...",
  },
  {
    question: "Can I find roommates in my city/university?",
    answer: "Currently we show all users (with optional filters coming soon)...",
  },
  {
    question: "Is my data safe?",
    answer: "We take privacy seriously. Your answers are stored securely...",
  }
];

const Landing = () => {
  const [openFaq, setOpenFaq] = useState(null);

  const toggleFaq = (index) => {
    setOpenFaq(openFaq === index ? null : index);
  };

  return (
    <div className="landing-page">

      {/* ‚îÄ‚îÄ TOP NAVIGATION BAR ‚îÄ‚îÄ */}
      <nav className="navbar">
        <div className="nav-container">
          <div className="nav-links">
            <a href="#contact" className="nav-link">Contact Us</a>
            <a href="#faq" className="nav-link">FAQ</a>
            <a href="#tips" className="nav-link">How to Be a Better Roommate</a>
          </div>
        </div>
      </nav>

      {/* Decorations */}
      <div className="decor-bear-1">üß∏</div>
      <div className="decor-bear-2">üêª</div>
      <div className="decor-heart">üíï</div>
      <div className="decor-cloud-1">‚òÅÔ∏è</div>
      <div className="decor-cloud-2">‚òÅÔ∏è</div>

      {/* HERO */}
      <section className="hero-section">
        <h1 className="main-title">RoomieRadar</h1>
        <p className="tagline">
          Find your perfect roommate with a big warm hug~! üß∏üíï<br />
          Answer fun questions ‚Üí Get real compatibility scores, conflict forecasts & cozy living tips!
        </p>

        <div className="cta-buttons">
          <Link to="/questionnaire">
            <button style={{
              background: 'linear-gradient(90deg, #ff7b8c, #ffcc99)',
              color: 'white',
              padding: '1.2rem 2.8rem',
              fontSize: '1.35rem',
              fontWeight: '700',
              borderRadius: '999px',
              border: 'none',
              boxShadow: '0 12px 35px rgba(255,123,140,0.5)',
              minWidth: '260px'
            }}>
              Start Matching Now ‚ô°
            </button>
          </Link>

          <Link to="/dashboard">
            <button style={{
              background: 'white',
              color: '#a66f5c',
              padding: '1.2rem 2.8rem',
              fontSize: '1.35rem',
              fontWeight: '700',
              borderRadius: '999px',
              border: '3.5px solid #ffb3c1',
              boxShadow: '0 10px 30px rgba(166,111,92,0.2)',
              minWidth: '260px'
            }}>
              See Dashboard ‚úß
            </button>
          </Link>
        </div>

        <div className="hero-illustration-container">
          <img
            src="/assets/images/roomie-illustration.png"
            alt="Happy cute roommates chilling together"
            className="hero-illustration"
          />
        </div>
      </section>

      {/* FEATURES */}
      <section className="features-section">
        <h2 className="section-title">What You Can Do</h2>
        {/* ... existing features grid ... */}
      </section>

      {/* GOOD ROOMMATE TIPS */}
      <section id="tips" className="tips-section">
        <h2 className="section-title">How to Be a Great Roommate</h2>
        <div className="tips-grid">
          {/* ... existing tips ... */}
        </div>
      </section>

      {/* FAQ */}
      <section id="faq" className="faq-section">
        <h2 className="section-title">Frequently Asked Questions</h2>
        {faqData.map((item, index) => (
          <div key={index} className="faq-item">
            <button
              className="faq-question"
              onClick={() => toggleFaq(index)}
            >
              {item.question}
              <span>{openFaq === index ? '‚àí' : '+'}</span>
            </button>
            <div className={`faq-answer ${openFaq === index ? 'open' : ''}`}>
              {item.answer}
            </div>
          </div>
        ))}
      </section>

      {/* FOOTER / CONTACT */}
      <footer id="contact" className="footer">
        <h3 className="footer-title">Made with ‚ô° by RoomieRadar Team</h3>
        <p style={{ marginBottom: '1.5rem', color: '#8c6f66' }}>
          Have questions or suggestions? We'd love to hear from you~
        </p>

        <div className="social-links">
          <a href="mailto:hello@roomieradar.com">‚úâÔ∏è hello@roomieradar.com</a>
        </div>

        <p className="copyright">
          ¬© {new Date().getFullYear()} RoomieRadar ‚Ä¢ All rights reserved
        </p>
      </footer>
    </div>
  );
};

export default Landing;
